import { useState, useEffect } from 'react';
const useFetch = (url) => {

    const [amount, setAmount] = useState(null);

    const [data, setData] = useState(null);

    fetch("http://localhost:8001/transactions")
        .then(res => {
            return res.json();
        })
        .then(data => {
            console.log(data);
            setData(data);
        })



    return { data, setData };
}

export default useFetch;
